import React, {useState} from 'react';

function App() {
  const [todos, setTodos] = useState([
    {
    text: 'Learn about React',
    isCompleted: false
    },
    {
    text: 'Meet friends for lunch',
    isCompleted: false
    },
    {
    text: 'Build really cool todo app',
    isCompleted: false
    }
  ]);



}

export default App;
